                    { 
                        $match:  { 
                            "location.catchments" : {$in: [projectData.location.catchments]} ,
                            "_id" :         {$ne: projectData._id}    
                        } 
                    },
                    { $sort:   { name: 1,  leadOrg: 1 } }
